import { Component} from 'react';
import Api from '../../services/api';

import {useParams} from 'react-router-dom';

export default class Profile extends Component{

    state = {};

    idUser = useParams();
    
    componentDidMount(){
        const config = {
            headers:{
                Authorization:localStorage.getItem('token')
        }
        
    }
    Api.put('updateUser/'+idUser,config).then(
        res =>{
            this.setState({
                userDoctor:res.data
            })
        },
        err =>{
            console.log(">>>>>erro editar perfil form>>>>>>>>>>>",err);
        }
    )
    };

    signUp(){
        localStorage.clear();
        window.location.href='/'
    }
    
    render() {

        if(this.state.userDoctor){
            return(
                <div>
                    <h2>Tela de editar perfil</h2>
                    <br/>
                    <div>
                        <form className="form">
                        <text>Editar Perfil</text>
                        <br/>
                            <label>
                                Especificação:
                                <input type="text" />
                            </label>
                            <br/>
                            <label>
                                Telefone:
                                <input type="text" />
                            </label>
                            <div>
                            
                            <button buttonSize='btn--large' type="submit">Editar</button>
                            </div>
                        </form>
                        
                    </div>
                </div>
            )
        }
        

        return(
            <div>

            </div>
        )

    }
}
